import React from "react";
import Navbar from "../navbar-footer/Navbar";

const mockPrescriptions = [
  {
    prescriptionDate: "2025-06-02",
    patientName: "John Doe",
    patientAge: 35,
    patientGender: "Male",
    diagnosis: ["Diabetes", "Hypertension"],
    medicines: ["Metformin", "Amlodipine"],
    nextVisitDate: "2025-07-02",
  },
  {
    prescriptionDate: "2025-06-01",
    patientName: "Jane Smith",
    patientAge: 28,
    patientGender: "Female",
    diagnosis: ["Migraine"],
    medicines: ["Sumatriptan"],
    nextVisitDate: "2025-06-15",
  },
];

function PrescriptionList() {
  return (
    <>
      <Navbar />
      <div style={styles.container}>
        <h2 style={styles.title}>Prescription List</h2>
        <table style={styles.table}>
          <thead>
            <tr>
              <th>Prescription Date</th>
              <th>Patient Name</th>
              <th>Age</th>
              <th>Gender</th>
              <th>Diagnosis</th>
              <th>Medicines</th>
              <th>Next Visit Date</th>
            </tr>
          </thead>
          <tbody>
            {mockPrescriptions.map((prescription, index) => (
              <tr key={index}>
                <td>{prescription.prescriptionDate}</td>
                <td>{prescription.patientName}</td>
                <td>{prescription.patientAge}</td>
                <td>{prescription.patientGender}</td>
                <td>{prescription.diagnosis.join(", ")}</td>
                <td>{prescription.medicines.join(", ")}</td>
                <td>{prescription.nextVisitDate}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
}

const styles = {
  container: {
    marginTop: "80px",
    padding: "20px",
    maxWidth: "1000px",
    marginLeft: "auto",
    marginRight: "auto",
  },
  title: {
    textAlign: "center",
    marginBottom: "20px",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    fontSize: "16px",
  },
  th: {
    backgroundColor: "#2c3e50",
    color: "white",
    padding: "10px",
    textAlign: "left",
  },
  td: {
    padding: "10px",
    borderBottom: "1px solid #ccc",
  },
};

export default PrescriptionList;
